import styled from "styled-components";

const Button = ({ content }) => {
    return(
        <>
            <ButtonStyle>{content}</ButtonStyle>
        </>
    );
}

const ButtonStyle = styled.button`
    padding: ${rem(spacing.large)};
`;

export default Button;
